INSERT INTO `jd_article` VALUES ('5', 'LASSIC Golden Kitchen Tools 2017 Catalog', '&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;/Public/admin/image/20171113/1510562909636721.jpg&quot; title=&quot;1510562909636721.jpg&quot; alt=&quot;资源内页(设计2)_03.jpg&quot;/&gt;&lt;/p&gt;&lt;p style=&quot;text-align: left;&quot;&gt;&lt;span style=&quot;font-family: arial, helvetica, sans-serif;&quot;&gt;Never before, a kitchen had such a history. It tells the story of the “American dream”. At the end of the 19th century, a new generation of successful entrepreneurs Dream of an architectural style that expressed their prosperity. &amp;nbsp; &amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial, helvetica, sans-serif;&quot;&gt;Their wishes were fulfilled by young American architects who studied at the École des Beaux Arts in Paris.&amp;nbsp;&lt;/span&gt;&lt;br/&gt;&lt;/p&gt;&lt;p style=&quot;text-align: left;&quot;&gt;&lt;img src=&quot;/Public/admin/image/20171113/1510562945436933.jpg&quot; title=&quot;1510562945436933.jpg&quot; alt=&quot;资源内页(设计2)_06.jpg&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: arial, helvetica, sans-serif;&quot;&gt;They introduced a new style in architecture and interior design named after the famous art academy. Actually, luxury-Arts was not a new style. It was a composition of styles resulting from various cultures just like America itself. And like the kitchens of the new collection, For successful people today, all over the world.&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;/Public/admin/image/20171113/1510563036188257.jpg&quot; title=&quot;1510563036188257.jpg&quot; alt=&quot;资源内页(设计2)_09.jpg&quot;/&gt;&lt;/p&gt;', '/Public/Uploads/article/2017-11-13/1510563091.jpg', null, '1', '1510565791', '1', '122', '2017');
