INSERT INTO `jd_prods` VALUES ('74', 'PR-D600BA0395', 'Silicone Lollipop Mold', '', '<p><span style=\"font-size: 16px;\"></span>ITEM:PR-D600BA0395<br/>DESC:SILICONE LOLLIPOP MOLD<br/>COLOR BOX<br/>QTY.:24 PCS/CTN<br/>MEAS.:54.0*44.0*30.0=0.07100CBM<br/>20&#39; loaded:9120PCS<br/>40&#39; loaded:19272PCS<br/>MOQ:2,000<br/><br/></p>', '<p><span style=\"font-size: 16px;\"></span>COLOR BOX<br/></p>', '<p><span style=\"font-size: 16px;\"></span>Small pastry molds design to make 20 round cake pops lollipop easily.&nbsp;&nbsp; Flexible silicone non-stick surface, stain and odor-resistant.&nbsp; <br/></p><p>Perfect for kid&#39;s or themed parties, birthday parties, holidays, weddings and other celebrations.</p>', '267', '1', '1.00', '0.00', '2017-01-18/50_587f403e8dfde.jpg', '2017-01-18/587f403e8dfde.jpg', '2000', '1484734526', '1500431886', '0', '0', '0', '', '', 'javascript:void(0);', '1');
