INSERT INTO `jd_prods` VALUES ('80', 'PR-D611KA0007', 'Silicone Table Mat', '', '<p><span style=\"font-size: 16px;\"></span>ITEM:PR-D611KA0007<br/>DESC:SILICONE TABLE MAT<br/>BIND CARD<br/>QTY.:72 PCS/CTN<br/>MEAS.:34.0*48.0*20.5=0.03300CBM<br/>20&#39; loaded:61056PCS<br/>40&#39; loaded:126576PCS<br/>MOQ:2,000<br/><br/></p>', '<p><span style=\"font-size: 16px;\"></span>BIND CARD</p>', '<p><span style=\"font-size: 16px;\"></span>Use it as a pot holder, trivet, jar opener, spoon rest or anywhere you need extra grip or exteme heat.</p><p>Insulation performance, non-slip, suitable for kitchen table mats, bowls mat, dish mats, pot holders, coasters, table mats, etc.</p><p>Cutout hole for easy hanging, Skid and slip resistant.<br/></p>', '734', '1', '1.00', '0.00', '2017-01-18/50_587f4f6a1e9f7.jpg', '2017-01-18/587f4f6a1e9f7.jpg', '2000', '1484738410', '1501669494', '0', '0', '0', '', '', 'javascript:void(0);', '1');
