INSERT INTO `jd_prods` VALUES ('495', 'N-G600KX0471', 'Acacia Cutting Board', 'cutting board', '<p style=\'font-family: Arial;font-size:16px;\'>ITEM:N-G600KX0471<br/>DESC:ACACIA CUTTING BOARD<br/>HANG TAG<br/>QTY.:24 PCS/CTN<br/>MEAS.:44.0*35.5*19.5=0.030CBM<br/>20\' loaded:22392PCS<br/>40\' loaded:46392PCS<br/>MOQ:2,000<br/></p>', '<p style=\'font-family: Arial;font-size:16px;\'>HANG TAG</p>', '<p style=\'font-family: Arial;font-size:16px;\'>•Naturally Antibacterial<br/>Like many types of wood, acacia is naturally antibacterial, and is therefore safe to use for preparing or serving food.<br/>•Properties and Qualities-We acacia wood for many of our kitchen collections because it is both extremely durable and water-resistant - ideal for heavy-use items that are in frequent contact with liquids.<br/>•Comfortable handle with a ring hole to make it easy handing</p>', '174', '0', '1.00', '0.00', null, null, '2000', '1505973121', '0', '0', '0', '0', '', '', '', '1');
