-- ----------------------------
-- Table structure for jd_address
-- ----------------------------
DROP TABLE IF EXISTS `jd_address`;
CREATE TABLE `jd_address` (
  `addressId` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `receiver` char(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '收货人',
  `tel` char(20) NOT NULL COMMENT '联系电话',
  `address` varchar(128) NOT NULL COMMENT '送货地址',
  `userId` int(11) NOT NULL COMMENT '用户id 对应jd_users表 id',
  `isDefault` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否默认  1->是 0->否',
  `hometel` char(20) DEFAULT NULL COMMENT '家庭电话',
  `email` char(32) DEFAULT NULL COMMENT '邮箱',
  `addressbie` varchar(255) DEFAULT NULL COMMENT '地址别名',
  `payment` tinyint(1) NOT NULL DEFAULT '0' COMMENT '支付方式 0->货到付款 1->在线支付 2->分期付款',
  `delivery` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0->快递 1->自提',
  `provinceId` int(11) NOT NULL COMMENT '省id',
  `cityId` int(11) NOT NULL COMMENT '市id',
  `countyId` int(11) NOT NULL COMMENT '区id',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态 1->启用 0->禁用',
  `number` int(1) NOT NULL COMMENT '限定5个地址1-5排序',
  `PostalCode` varchar(6) NOT NULL COMMENT '邮编',
  `Express` int(1) NOT NULL COMMENT '1=>Fedex 2=>UPS 3=>TNT 4=>DHL 5=>SF-EXPRESS 6=>Other',
  `Expressother` varchar(50) DEFAULT NULL,
  `Service` int(1) NOT NULL COMMENT '1=>Intl.Priority 2=>Intl.Economy 3=>Other',
  `AcountNo` varchar(20) NOT NULL,
  `Serviceother` varchar(30) NOT NULL,
  `add_time` int(11) NOT NULL DEFAULT '0',
  `updata_time` int(11) DEFAULT '0',
  PRIMARY KEY (`addressId`)
) ENGINE=MyISAM AUTO_INCREMENT=14 DEFAULT CHARSET=utf8 COMMENT='收货信息表';

