  `i_number` varchar(42) NOT NULL,
  `gremark` mediumtext,
  `status` int(1) NOT NULL DEFAULT '0' COMMENT '状态 0->启用 1->禁用',
  PRIMARY KEY (`id`),
  KEY `userId` (`userId`),
  KEY `prodId` (`prodName`),
  KEY `sizeId` (`size`),
  KEY `colorId` (`color`),
  KEY `inqid` (`inqid`),
  KEY `i_number` (`i_number`),
  KEY `status` (`status`)
) ENGINE=MyISAM AUTO_INCREMENT=49 DEFAULT CHARSET=utf8 COMMENT='询价单产品';

