-- ----------------------------
-- Table structure for jd_prods
-- ----------------------------
DROP TABLE IF EXISTS `jd_prods`;
CREATE TABLE `jd_prods` (
  `prodId` int(11) NOT NULL AUTO_INCREMENT COMMENT '商品id',
  `prodNO` char(32) NOT NULL COMMENT '商品编号 唯一',
  `prodName` char(128) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '商品名',
  `keyword` char(128) DEFAULT NULL COMMENT '搜索关键字',
  `prodInfo` mediumtext COMMENT '商品详情/商品描述',
  `paking` mediumtext NOT NULL COMMENT 'paking',
  `wbi` mediumtext NOT NULL COMMENT 'why buy it',
  `proTypeId` int(11) NOT NULL DEFAULT '1000',
  `brandId` int(11) NOT NULL COMMENT '风格id',
  `price1` double(10,2) NOT NULL COMMENT '商品原价',
  `price2` double(10,2) NOT NULL COMMENT '商品现价',
  `simimg` char(100) DEFAULT NULL COMMENT '商品缩略图',
  `img` char(100) DEFAULT NULL COMMENT '商品原图',
  `mqq` char(32) DEFAULT NULL COMMENT 'MOQ',
  `create_time` int(11) NOT NULL COMMENT '创建时间',
  `updata_time` int(11) NOT NULL COMMENT '修改时间',
  `isNew` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否显示NEW 1->是 0>否',
  `isHot` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否热门 1->是 0->否',
  `totalSale` int(11) NOT NULL COMMENT '总售出数量',
  `businessId` char(128) NOT NULL COMMENT '认证 logo id 逗号分割 对应jd_authentication 表id',
  `banner` char(100) NOT NULL COMMENT '广告图',
  `banner_link` char(100) NOT NULL COMMENT '广告图连接',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '商品状态 1->启用 0->禁用',
  PRIMARY KEY (`prodId`),
  KEY `price1` (`price1`),
  KEY `price2` (`price2`),
  KEY `create_time` (`create_time`),
  KEY `updata_time` (`updata_time`),
  KEY `price` (`price1`,`price2`,`status`) USING BTREE,
  KEY `time` (`create_time`,`updata_time`,`status`) USING BTREE,
  KEY `status` (`status`)
) ENGINE=MyISAM AUTO_INCREMENT=739 DEFAULT CHARSET=utf8 COMMENT='商品表';

