-- ----------------------------
-- Table structure for jd_products
-- ----------------------------
DROP TABLE IF EXISTS `jd_products`;
CREATE TABLE `jd_products` (
  `productId` int(11) NOT NULL AUTO_INCREMENT COMMENT '商品详细id',
  `prodId` int(11) NOT NULL COMMENT '商品id 对应jd_prods表的prodId',
  `productNO` char(32) NOT NULL COMMENT '商品编号 唯一',
  `colorId` smallint(6) DEFAULT NULL COMMENT '颜色id 对应jd_color表的colorId',
  `sizeId` tinyint(4) DEFAULT NULL COMMENT '尺寸id 对应jd_size表的sizeId',
  `price` double(8,2) NOT NULL COMMENT '商品单价',
  `amount` int(11) NOT NULL DEFAULT '0' COMMENT '商品库存',
  `gendarId` tinyint(4) DEFAULT NULL COMMENT '性别id 对应jd_gendars表的gendarId',
  `proTypeId` int(11) NOT NULL COMMENT '商品类别id 对应jd_proType表的proTypeId',
  `brandId` int(11) NOT NULL COMMENT '品牌id 对应jd_brands表的brandId',
  `commentNum` int(11) NOT NULL DEFAULT '0' COMMENT '商品评论数',
  `saleNum` int(11) NOT NULL DEFAULT '0' COMMENT '卖出数量',
  `addtime` int(11) NOT NULL COMMENT '创建时间',
  `updata_time` int(11) NOT NULL COMMENT '修改时间',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态 1->启用 0->禁用',
  `isDefault` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否默认 1->是 0->否',
  PRIMARY KEY (`productId`),
  KEY `prodId` (`prodId`),
  KEY `colorId` (`colorId`),
  KEY `sizeId` (`sizeId`),
  KEY `gendarId` (`gendarId`),
  KEY `brandId` (`brandId`),
  KEY `proTypeId` (`proTypeId`),
  KEY `status` (`status`),
  KEY `type` (`proTypeId`,`status`) USING BTREE,
  KEY `brand` (`brandId`,`status`),
  KEY `prods` (`prodId`,`status`),
  KEY `color` (`colorId`,`status`),
  KEY `size` (`sizeId`,`status`),
  KEY `gendar` (`gendarId`,`status`),
  KEY `brand_type` (`proTypeId`,`brandId`,`status`),
  KEY `color_type` (`colorId`,`proTypeId`,`status`),
  KEY `size_type` (`sizeId`,`proTypeId`,`status`),
  KEY `gendar_type` (`gendarId`,`proTypeId`,`status`),
  KEY `color_size` (`colorId`,`sizeId`,`status`),
  KEY `color_gendar` (`colorId`,`gendarId`,`status`),
  KEY `color_brand` (`colorId`,`brandId`,`status`),
  KEY `size_gendar` (`sizeId`,`gendarId`,`status`),
  KEY `size_brand` (`sizeId`,`brandId`,`status`),
  KEY `color_brand_size` (`colorId`,`brandId`,`sizeId`,`status`),
  KEY `color_brand_size_gendar_type` (`colorId`,`sizeId`,`brandId`,`status`,`gendarId`,`proTypeId`) USING BTREE,
  KEY `color_brand_gendar` (`colorId`,`brandId`,`gendarId`,`status`),
  KEY `color_brand_type` (`colorId`,`brandId`,`proTypeId`,`status`),
  KEY `size_brand_type` (`sizeId`,`brandId`,`proTypeId`,`status`),
  KEY `color_size_gendar` (`colorId`,`sizeId`,`gendarId`,`status`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=583 DEFAULT CHARSET=utf8 COMMENT='商品详细表';

