  KEY `typeName` (`typeName`),
  KEY `proTypeId` (`proTypeId`),
  KEY `status` (`status`),
  KEY `Lv` (`lv`),
  KEY `pid` (`pid`),
  KEY `child` (`child`),
  KEY `radio` (`radio`),
  KEY `top` (`top`)
