  `newsId` int(11) NOT NULL AUTO_INCREMENT COMMENT '新闻id',
  `newsInfo` text NOT NULL COMMENT '新闻信息',
  `prodId` int(11) NOT NULL COMMENT '商品id 对应 jd_prods表的prodId',
  `proTypeId` int(11) NOT NULL COMMENT '商品分类id 对应jd_proType表的proTypeId',
  `brandId` int(11) NOT NULL COMMENT '品牌id 对应jd_brand表的brandId',
  `is_checked` tinyint(4) NOT NULL DEFAULT '1' COMMENT '审核状态 1->未审核 0->已审核通过',
  `is_show` tinyint(4) NOT NULL DEFAULT '0' COMMENT '显示状态 1->显示 0->不显示',
  `activity` tinyint(3) NOT NULL COMMENT '推广类型 0->优惠促销 1->限时抢购 2->推广商品',
  PRIMARY KEY (`newsId`)
) ENGINE=MyISAM AUTO_INCREMENT=8 DEFAULT CHARSET=utf8 COMMENT='站内新闻表';

