-- Table structure for jd_user_shop_cart
-- ----------------------------
DROP TABLE IF EXISTS `jd_user_shop_cart`;
CREATE TABLE `jd_user_shop_cart` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `userId` int(11) NOT NULL COMMENT '用户id',
  `productId` int(11) NOT NULL COMMENT '产品id 对应 jd_products 的productId',
  `productNO` char(32) DEFAULT NULL COMMENT '商品详细编号',
  `prodName` char(64) NOT NULL COMMENT '商品名称',
  `img` char(128) NOT NULL COMMENT '图片 路径：''/Public/Uploads/''',
  `type` mediumtext COMMENT '产品的属性',
  `content` mediumtext COMMENT '商品描述',
  `sizeId` int(11) NOT NULL,
  `size` char(32) NOT NULL COMMENT '尺寸',
  `colorId` int(11) NOT NULL,
  `color` char(32) DEFAULT NULL COMMENT '颜色',
  `rgbimg` char(128) DEFAULT NULL COMMENT '//颜色图',
  `number` int(11) NOT NULL DEFAULT '1' COMMENT '数量',
  `price` decimal(10,2) DEFAULT NULL COMMENT '单价',
  `remark` mediumtext COMMENT '//备注',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  `update_time` int(11) NOT NULL DEFAULT '0' COMMENT '最后修改时间',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态 1->启用 0->禁用',
  `is_order` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否已下单 1->是 0->否',
  PRIMARY KEY (`id`),
  KEY `userId` (`userId`),
  KEY `prodId` (`prodName`),
  KEY `sizeId` (`size`),
  KEY `colorId` (`color`),
  KEY `status` (`status`),
  KEY `is_order` (`is_order`)
) ENGINE=MyISAM AUTO_INCREMENT=40 DEFAULT CHARSET=utf8 COMMENT='用户购物车';

