-- ----------------------------
-- Table structure for jd_users
-- ----------------------------
DROP TABLE IF EXISTS `jd_users`;
CREATE TABLE `jd_users` (
  `userId` int(11) NOT NULL AUTO_INCREMENT COMMENT '用户id',
  `uname` char(32) DEFAULT NULL COMMENT '账户名（唯一存在）',
  `upwd` char(32) DEFAULT NULL COMMENT '账户密码，md5加密一次',
  `nickName` char(50) DEFAULT NULL COMMENT '用户昵称',
  `sex` tinyint(1) NOT NULL DEFAULT '0' COMMENT '性别 0->未知 1->男 2->女',
  `country` char(32) DEFAULT NULL,
  `usertel` char(20) DEFAULT NULL COMMENT '手机号码',
  `useremail` char(50) NOT NULL COMMENT '用户邮箱地址',
  `userCompany` char(64) NOT NULL COMMENT '公司名',
  `userCompanyPhone` char(32) NOT NULL COMMENT '公司电话',
  `userContact` char(64) NOT NULL COMMENT '联系人',
  `zy_title` char(64) DEFAULT NULL COMMENT '职位',
  `address` mediumtext COMMENT '详细联系地址',
  `website` mediumtext COMMENT '官网',
  `business_type` char(64) DEFAULT NULL COMMENT '职业类型',
  `reg_time` int(11) NOT NULL,
  `reg_ip` bigint(20) NOT NULL,
  `login_count` int(11) NOT NULL DEFAULT '0',
  `login_time` int(11) DEFAULT NULL,
  `login_ip` int(11) DEFAULT NULL,
  `business_card` char(128) DEFAULT NULL,
  `business_card_mini` char(128) DEFAULT NULL,
  `lzhengNamen` char(32) DEFAULT NULL COMMENT '真实姓名',
  `sfz` char(20) DEFAULT NULL COMMENT '身份证',
  `userdizhi` varchar(255) DEFAULT NULL COMMENT '用户所在地',
  `userday` char(12) DEFAULT NULL COMMENT '生日',
  `hunyi` tinyint(4) DEFAULT '0' COMMENT '婚姻状况 1->已婚 0->未婚',
  `ymoney` double(10,2) DEFAULT NULL COMMENT '月收入',
  `xqah` varchar(64) DEFAULT NULL COMMENT '兴趣，爱好',
  `userimg` char(128) DEFAULT NULL COMMENT '头像',
  `userHYdjId` tinyint(4) DEFAULT '0' COMMENT '会员等级',
  `userGWdjId` tinyint(4) DEFAULT '0' COMMENT '购物行为评级',
  `userJF` smallint(6) DEFAULT '0' COMMENT '用户积分',
  `userGCS` smallint(6) DEFAULT '0' COMMENT '购物次数',
  `userCZ` smallint(6) DEFAULT NULL COMMENT '成长值',
  `userCare` text COMMENT '关注',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态 1->启用 0->禁用',
  `FB_openid` char(32) DEFAULT NULL COMMENT 'facebook openid',
  `TW_openid` char(32) DEFAULT NULL COMMENT 'twitter openid',
  `adminId` int(11) NOT NULL COMMENT '所属业务员Id',
  `reviewed` tinyint(1) NOT NULL DEFAULT '0' COMMENT '审核状态 0->未审核 1->审核通过 ',
  PRIMARY KEY (`userId`),
  UNIQUE KEY `uname` (`uname`),
  KEY `hunyi` (`hunyi`),
  KEY `status` (`status`),
  KEY `adminId` (`adminId`)
) ENGINE=MyISAM AUTO_INCREMENT=72 DEFAULT CHARSET=utf8 COMMENT='用户表';

-- ----------------------------
-- Records of jd_users
