-- ----------------------------
-- Table structure for jd_zc
-- ----------------------------
DROP TABLE IF EXISTS `jd_zc`;
CREATE TABLE `jd_zc` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` char(100) NOT NULL COMMENT '标题',
  `content` text NOT NULL COMMENT '内容、描述',
  `price` decimal(10,2) NOT NULL COMMENT '单价',
  `image` char(128) NOT NULL COMMENT '图片',
  `expect_number` int(11) NOT NULL COMMENT '期待数量',
  `current_number` int(11) NOT NULL COMMENT '当前数量',
  `start_time` int(11) NOT NULL COMMENT '开始时间',
  `end_time` int(11) NOT NULL COMMENT '结束时间',
  `top` tinyint(2) NOT NULL DEFAULT '0' COMMENT '排序 越大越前',
  `status` tinyint(1) NOT NULL COMMENT '状态 1->启用 0->禁用',
  PRIMARY KEY (`id`),
  KEY `status` (`status`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='众筹表';

