  `id` int(11) NOT NULL AUTO_INCREMENT,
  `zc_id` int(11) NOT NULL COMMENT '众筹id 对应jd_zc表的id',
  `start` int(11) NOT NULL COMMENT '每阶级开始数量 判断时大于此值',
  `end` int(11) NOT NULL COMMENT '每阶梯结束数值 判断时小于等于此值',
  `price` decimal(10,2) NOT NULL COMMENT '每阶级数量单价',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态 1->启用 0->禁用',
  PRIMARY KEY (`id`),
  KEY `zc_id` (`zc_id`),
  KEY `status` (`status`)
) ENGINE=MyISAM AUTO_INCREMENT=8 DEFAULT CHARSET=utf8 COMMENT='众筹详情表';

