DROP TABLE IF EXISTS `jd_zc_order_details`;
CREATE TABLE `jd_zc_order_details` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `orderId` int(11) NOT NULL COMMENT '订单id 对应jd_zc_orders表的orderId',
  `zc_id` int(11) NOT NULL COMMENT '众筹id 对应jd_zc表id',
  `zc_conf_id` int(11) NOT NULL COMMENT '众筹数量阶梯id 对应jd_zc_conf表的id',
  `number` int(11) NOT NULL COMMENT '数量',
  `price` decimal(10,2) NOT NULL COMMENT '单价',
  `order_time` int(11) NOT NULL COMMENT '下单时间',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态 1->成功 0->取消',
  PRIMARY KEY (`id`),
  UNIQUE KEY `orderno` (`orderId`),
  KEY `zc_id` (`zc_id`),
  KEY `zc_conf_id` (`zc_conf_id`),
  KEY `status` (`status`)
