-- ----------------------------
-- Table structure for jd_zc_orders
-- ----------------------------
DROP TABLE IF EXISTS `jd_zc_orders`;
CREATE TABLE `jd_zc_orders` (
  `orderId` int(11) NOT NULL AUTO_INCREMENT COMMENT '订单id',
  `orderno` char(32) NOT NULL COMMENT '订单编号 （唯一，由userid+时间戳+1位随机数组成)',
  `userId` int(11) NOT NULL COMMENT '用户id',
  `receiver` char(24) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '收货人',
  `tel` char(12) NOT NULL COMMENT '联系方式',
  `hometel` char(12) DEFAULT NULL COMMENT '家庭电话',
  `address` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '收货地址',
  `orderTime` int(11) NOT NULL COMMENT '下单时间',
  `orderState` tinyint(4) NOT NULL DEFAULT '0' COMMENT '订单状态 0->等待商家发货 1->商家已发货，等待用户收获 2->交易完成 3->订单取消',
  `email` char(32) CHARACTER SET utf8 DEFAULT NULL COMMENT '邮箱地址',
  `addressbie` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '地址别名',
  `send_sample` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否需要寄样 1->是 0->否',
  `sample_status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '寄样状态 0->待发货 1->已发',
  PRIMARY KEY (`orderId`),
  UNIQUE KEY `orderno` (`orderno`),
  KEY `orderState` (`orderState`),
  KEY `send_sample` (`send_sample`),
  KEY `userId` (`userId`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=latin1 COMMENT='订单表';

-- ----------------------------
-- Records of jd_zc_orders
-- ----------------------------

-- ----------------------------
-- Table structure for jd_zt_conf
