CREATE TABLE `jd_zt_conf` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` char(32) NOT NULL COMMENT '//模块名',
  `view` char(64) NOT NULL COMMENT '//对应配置视图',
  `view_img` varchar(200) NOT NULL DEFAULT '' COMMENT '图片地址',
  `type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '//类型 0->pc端 1->移动端',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '//状态 1->启用 0->禁用',
  `prodTypeId` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `only` (`name`,`view`,`type`,`status`,`prodTypeId`) USING BTREE,
  KEY `name` (`name`),
  KEY `type` (`type`),
  KEY `status` (`status`),
  KEY `prodTypeId` (`prodTypeId`)
) ENGINE=MyISAM AUTO_INCREMENT=17 DEFAULT CHARSET=utf8;

